page.text:
\dred{Strings}: (a piece of text)\\
Write text between quotation marks (|"| and |'| are both allowed):
\begin{V}
"CS101 is wonderful"
'The instructor said: "Well done!" and smiled'
\end{V}

Complicated objects are made by calling functions that create them:
\begin{V} from cs1robots import * Robot()
from cs1media import * load_picture("photos/geowi.jpg") \end{V}

Good:

\begin{V}
my_message = "CS101 is fantastic"
a13 = 13.0
\end{V}

Bad:

\begin{V}
more\char64 = "illegal character"
13a = 13.0
def = "Definition 1"
\end{V}

Names are often called \dred{variables}, because the meaning of a name is variable:  the same name can be assigned to different objects during a program:

\begin{V}
n = 17
n = "Seventeen"
n = 17.0
\end{V}

To indicate that a variable is \dred{empty}, we use the special object |None| (of type |NoneType|):

\begin{V}
m = None
\end{V}

The methods of an object are used through \dred{dot-syntax}:

\begin{V}
>>> hubo = Robot()
>>> hubo\dred@.move()$
>>> hubo\dred@.turn_left()$
\end{V}

\begin{V}
>>> img = load_picture()
>>> print img\dred@.size()$
(58, 50)
>>> img\dred@.show()$
\end{V}

\begin{V}
>>> b = "banana"
>>> print b\dred@.upper()$
BANANA
\end{V}

For numbers, we use the operators |+|, |-|, |*|, |/|, |//|, |%|, and |**|.

\begin{V}
>>> 2**16
65536
\end{V}

\begin{V}
>>> 7 % 3
1
\end{V}

|//| is integer division (division without fractional part):
\begin{V}
>>> 13.0 // 4.0
3.0
\end{V}

An \dred{expression} is a combination of objects, variables, operators, and function calls:

\begin{V}
3.0 * (2 ** 15 - 12 / 4) + 4 ** 3
\end{V}

The operators have precedence as in mathematics:
\begin{enumerate} \item exponentiation |**| \item multiplication and division |*|, |/|, |//|, |%| \item addition and subtraction |+|, |-| \end{enumerate}
When in doubt, use parentheses!

A tuple is an object that contains other objects:

\begin{V}
position = (3.14, -5, 7.5)
profs = ("Otfried Cheong", "Taisook Han", 
         "Jaehyuk Huh")
\end{V}

A tuple is a single object of type |tuple|:

\begin{V}
>>> print position, type(position)
(3.14, -5, 7.5)  <type 'tuple'>
\end{V}

We can ``unpack'' tuples:

\begin{V}
x, y, z = position
\end{V}

Packing and unpacking in one line:

\begin{V}
a, b = b, a
\end{V}

Colors are often represented as a tuple with three elements that specify the intensity of red, green, and blue light:
\begin{V} red = (255, 0, 0) blue = (0, 0, 255) white = (255, 255, 255) black = (0, 0, 0) yellow = (255, 255, 0) purple = (128, 0, 128)
from cs1media import * img = create_picture(100, 100, purple) img.show() img.set_pixels(yellow) img.show() \end{V}

A for-loop assigns integer values to a variable:

\begin{V}
for i in range(4):
  print i
\end{V}
prints 0, 1, 2, 3.

\begin{V}
from cs1media import *

img = load_picture("../photos/geowi.jpg")
w, h = img.size()
for y in range(h):
  for x in range(w):
    r, g, b = img.get(x, y)
    r, g, b = 255 - r, 255 - g, 255 - b
    img.set(x, y, (r, g, b))
img.show()
\end{V}

\begin{V}
from cs1media import *
threshold = 100
white = (255, 255, 255)
black = (0, 0, 0)

img = load_picture("../photos/yuna1.jpg")
w, h = img.size()
for y in range(h):
  for x in range(w):
    r, g, b = img.get(x, y)
    v = (r + g + b) // 3     # average of r,g,b
    if v > threshold:
        img.set(x, y, white)
    else:
        img.set(x, y, black)
img.show()
\end{V}

\begin{V}
hubo = Robot("lightblue")
hubo.move()
ami.turn_left()
ami.move()
\end{V}
